// ==UserScript==
// @name        Extended Photo Administration
// @match       https://photo.knuddels.de/photos-admin*
// @version     1.3
// @author      riesaboy
// @icon         data:image/x-icon;base64,
// @downloadURL https://raw.githubusercontent.com/inflames2k/Scripts/refs/heads/main/Extended_Photo_Administration.js
// ==/UserScript==

(function() {
    'use strict';

     const proxies = [
        'https://proxy.hovida.de/?',
        'https://proxy.mein-chatserver.de/?',
        'https://quizgame.bplaced.net/proxy/index.php?url='
      ];

    modifySearchLinks();
    modifyImgSources();
    addMacroLink();
    markUnderAge();
    addAiCheckButtons();

    function modifySearchLinks()
    {
      $('a:contains("Yandex"), a:contains("Google")').each(function (){
        $(this).attr("href", $(this).attr("href").replace('pro0l0p', 'pro0vl0p').replace('pro0l4ifxlm', 'pro0vl4ifxlm'));
      });
    }

    function modifyImgSources()
    {
      $('img').each(function() {
       //console.log($(this).attr("src"));
       $(this).attr("src", $(this).attr("src").replace('pro0l0p', 'pro0vl0p').replace('pro0l4ifxlm', 'pro0vl4ifxlm'));
      });
    }

    function markUnderAge()
    {
      var age = 18;
      var container;
      if(/photos-admin-profilecontrol.html/.test(window.location.href))
      {
        $('.user-info').each(function() {
            var startBracket = $(this).text().indexOf("(");
            var endBracket = $(this).text().indexOf(")", startBracket);
            var bracketContent = $(this).text().substring(startBracket + 1, endBracket);

            age = bracketContent.split(',')[1].trim();
            container = $(this).parent().parent().find('.photo_cell_header').last();

            if(Number(age) < 18)
            {
               container.parent().parent().css("background", "#F7BE81");
               container.parent().parent().css("background-color", "#F7BE81");
               $(this).css("background", "#F7BE81");
               $(this).css("background-color", "#F7BE81");

               container.find('a').css("background", "#F7BE81");
               container.find('a').css("background-color", "#F7BE81");
            }
        });
      }
      else if(/photos-admin-albumcontrol.html/.test(window.location.href))
      {
        $('.photo_content_wrapper .detaildata').each(function() {
            var startBracket = $(this).text().indexOf("(");
            var endBracket = $(this).text().indexOf(")", startBracket);
            var bracketContent = $(this).text().substring(startBracket + 1, endBracket);

            if(bracketContent)
            {
              age = bracketContent.split(',')[1].trim();

              container = $(this).parent();

                if(Number(age) < 18)
                {
                   container.css("background", "#F7BE81");
                   container.css("background-color", "#F7BE81");
                   container.css("backgroundColor", "#F7BE81");
                }
            }
        });
      }
    }

    function addMacroLink()
    {
      if(/photos-admin-profilecontrol.html/.test(window.location.href))
      {
          $('.user-info').each(function() {
            var name = $(this).text().split('(')[0].trim();

            var container = $(this).parent().parent().find('.photo_cell_header').last();

            container.append('<a href="#" class="macro" id="' + name + '">Bot</a>');

           // alert(container.html());
          });

          $('.macro').on("click", function() {
              var id = $(this).attr("id");

              navigator.clipboard.writeText('/macro bot:' + id);

              $(this).parent().parent().find('.select').val('FakeAttemptProfile');
              return false;;
          });
      }
    }

    // Neue Funktion zum Hinzufgen von KI-Check-Buttons
    function addAiCheckButtons() {
        // CSS fr die KI-Check-Buttons und Ergebnisse hinzufgen
        addAiDetectionStyles();

        var imageElements;
        var getUrlFromLink = false;

        if(/photos-admin-profilecontrol.html/.test(window.location.href) || /photos-admin-profile.html/.test(window.location.href))
        {
          imageElements = $('.new_photo .userimage');
        }
        else if(/photos-admin-albumcontrol.html/.test(window.location.href))
        {
          imageElements = $('li.album_image:not(.upload_normal) .userimage');
          getUrlFromLink = true;
        }

        // Fr jedes Bild einen KI-Check-Button hinzufgen
        imageElements.each(function(index) {
            var imgElement = $(this);

            // Wrapper um das Bild erstellen
            var imageWrapper = $('<div class="ai-image-wrapper"></div>');

            // Bild in den Wrapper verschieben
            imgElement.wrap(imageWrapper);

            // Button erstellen
            var aiCheckButton = $('<button class="ai-check-button">KI Check</button>');

            // Container fr die KI-Ergebnisse erstellen (am gleichen Ort wie der Button)
            var aiResultContainer = $('<div class="ai-result-container" style="display: none;"></div>');

            // Button und Ergebnis-Container zum Wrapper hinzufgen
            imgElement.parent().append(aiCheckButton);
            imgElement.parent().append(aiResultContainer);

            // Click-Event fr den Button
            aiCheckButton.on('click', function(e) {
                e.preventDefault();
                e.stopPropagation();

                $('.ai-check-button').prop('disabled', true);

                // Button deaktivieren und Ladetext anzeigen
                aiCheckButton.prop('disabled', true).text('Prfung...').removeClass('ai-error');

                // Vorherige Ergebnisse lschen
                aiResultContainer.empty();
                imgElement.removeClass('ai-generated-image');

                // Bild-URL bestimmen
                var imgUrl = 'https://photo.knuddels.de/' + (getUrlFromLink ?
                    imgElement.attr('alt').replace(/l(?!.*l)/, 'vl') :
                    imgElement.attr('src').replace(/(?<!v)l(?!.*l)/, 'vl'));

                console.log('Checking image:', imgUrl);

                // KI-Erkennung durchfhren
                checkImageForAi(imgUrl, function(result) {
                    if (result.error) {
                       // Fehler anzeigen
                       //aiResultContainer.html('<div class="ai-error">Fehler</div>');
                       console.error("AI detection error:", result.error);

                       aiCheckButton.prop('disabled', true).text('Fehler (Erneut?').addClass('ai-error');
                    } else {
                        // Ergebnis anzeigen
                        var probability = result.probability * 100;
                        var cssClass = probability >= 70 ? 'ai-high' :
                                       probability >= 50 ? 'ai-medium' : 'ai-low';

                        aiResultContainer.html('<div class="ai-result ' + cssClass + '">' + probability.toFixed(0) + '%</div>');

                        // Bei hoher KI-Wahrscheinlichkeit Rahmen um das Bild
                        if (probability >= 70) {
                            imgElement.addClass('ai-generated-image');
                        }
                        aiCheckButton.hide();
                    }

                    // Button ausblenden und Ergebnis anzeigen
                    //aiCheckButton.hide();
                    aiResultContainer.show();

                    // warte 1 sekunde und aktiviere dann alle anderen Buttons
                    setTimeout(function() {
                      $('.ai-check-button').prop('disabled', false);
                    }, 1000);
                });
            });
        });
    }

    // Funktion zum Hinzufgen von CSS-Stilen fr die KI-Erkennung
    function addAiDetectionStyles() {
        const styles = `
            .ai-image-wrapper {
                position: relative;
                display: inline-block;
            }
            .ai-check-button {
                position: absolute;
                top: 5px;
                right: 5px;
                background-color: #007bff;
                color: white;
                border: none;
                padding: 4px 8px;
                font-size: 11px;
                border-radius: 3px;
                cursor: pointer;
                z-index: 1000;
                transition: background-color 0.2s;
                opacity: 0.9;
            }
            .ai-check-button:hover {
                background-color: #0056b3;
                opacity: 1;
            }
            .ai-check-button:disabled {
                background-color: #6c757d;
                cursor: not-allowed;
            }
            .ai-result-container {
                position: absolute;
                top: 5px;
                right: 5px;
                z-index: 1000;
            }
            .ai-error {
                color: #dc3545;
                font-size: 11px;
                background-color: #f8d7da;
                padding: 4px 8px;
                border-radius: 3px;
                border: 1px solid #f5c6cb;
                display: inline-block;
                opacity: 0.9;
            }
            .ai-result {
                font-weight: bold;
                padding: 4px 8px;
                border-radius: 3px;
                display: inline-block;
                font-size: 11px;
                opacity: 0.9;
            }
            .ai-low {
                background-color: #d4edda;
                color: #155724;
                border: 1px solid #c3e6cb;
            }
            .ai-medium {
                background-color: #fff3cd;
                color: #856404;
                border: 1px solid #ffeaa7;
            }
            .ai-high {
                background-color: #f8d7da;
                color: #721c24;
                border: 1px solid #f5c6cb;
            }
            .ai-generated-image {
                border: 3px solid #dc3545 !important;
                box-shadow: 0 0 5px #dc3545;
            }
        `;

        $('<style>').text(styles).appendTo('head');
    }

    function uuidv4() {
      return "10000000-1000-4000-8000-100000000000".replace(/[018]/g, c =>
         (+c ^ crypto.getRandomValues(new Uint8Array(1))[0] & 15 >> +c / 4).toString(16)
      );
    }

    let currentProxyIndex = 0; // Globale Variable fr den aktuellen Index

    function getNextProxy(url) {
        let encoded = encodeURIComponent(url);

        // Aktuellen Proxy auswhlen
        let proxy = proxies[currentProxyIndex];

        // Index fr nchsten Aufruf erhhen
        currentProxyIndex = (currentProxyIndex + 1) % proxies.length;

        return proxy + url;
    }

    var clcnt = 0;

    async function checkImageForAi(imageUrl, callback)
    {
        try {
            // Ersten fetch synchron ausfhren
            const response = await fetch(imageUrl);
            if (!response.ok) {
                throw new Error(`HTTP error! status: ${response.status}`);
            }

            // Blob synchron erhalten
            const blob = await response.blob();

            // FormData vorbereiten
            const data = new FormData();
            const file = new File([blob], 'temp_' + Date.now() + '.jpg', {
                type: 'image/jpeg'
            });
            data.append('media', file);
            data.append('request_id', uuidv4());

            // API-Anfrage synchron ausfhren
            const apiResponse = await fetch(getNextProxy('https://plugin.hivemoderation.com/api/v1/image/ai_detection'), {
                method: 'POST',
                body: data
            });

            // JSON-Antwort synchron erhalten
            const apiData = await apiResponse.json();

            // Daten verarbeiten
            const classScores = {};
            apiData.data.classes.forEach(item => {
                classScores[item.class] = item.score;
            });

            const score = classScores.ai_generated;

            if (apiData) {
                callback({
                    isAi: score,
                    probability: score
                });
            } else {
                callback({ error: 'Ungltiges API-Antwortformat' });
            }

        } catch (error) {
            callback({ error: 'Bild konnte nicht geladen werden: ' + error.message });
        }
  }
})();
